1. Dateng langsung ke meja pendaftaran (di kanan pintu masuk). Disini dikasih tau kalo sekarang bisa daftar online 👍🏻;

2. Duduk nunggu dipanggil untuk bayar pelayanan (saya ga pake BPJS, dan bayar Rp 10.000 karena sesi siang. Kalo pagi bayar Rp 2.500, malem bayar Rp 15.000);

3. Duduk lagi di depan ruang praktek dokter, sambil nunggu dipanggil sama suster buat ditanya keluhannya, cek tensi, cek berat badan;

4. Dipanggil ke ruangan dokternya. Dikasih resep sama dokternya, kalo surat keterangan sakit dikasih juga sama dokternya, tapi minta cap di meja suster depan ruang praktek;

5. Menuju ruang farmasi, pencet nomer antrian, nunggu. Ga pake lama langsung dikasih obatnya. Kayanya udah diplastik2in jadi cepet.

Overall pelayanannya ada peningkatan, ruangannya juga bersih. Btw musholla di lantai 2, dan ada ruang bermain anak di samping ruang farmasi.

Selamat bertugas.', 'time': 1542966308}], 'scope': 'GOOGLE', 'types': ['hospital', 'health', 'point_of_interest', 'establishment'], 'url': 'https://maps.google.com/?cid=16575136794124476697', 'user_ratings_total': 52, 'utc_offset': 420, 'vicinity': 'Grand Depok City, Jalan Boulevard Grand Depok City, Jatimulya'}, 'status': 'OK'}

